import React, { useEffect, useState } from "react";
import "./App.css";
import { TrackPage } from "./pages/TracksPage";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<TrackPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
